import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as e,f as r}from"./app-b8e38156.js";const h={},i=r('<h2 id="实习" tabindex="-1"><a class="header-anchor" href="#实习" aria-hidden="true">#</a> 实习</h2><h3 id="一、中科全安" tabindex="-1"><a class="header-anchor" href="#一、中科全安" aria-hidden="true">#</a> 一、中科全安</h3><h4 id="一面-hr面-态度算好的-5分钟" tabindex="-1"><a class="header-anchor" href="#一面-hr面-态度算好的-5分钟" aria-hidden="true">#</a> 一面：HR面，态度算好的（5分钟）</h4><p>1.介绍公司</p><p>2.问啥时候能来实习</p><p>3.问你能接受加班吗</p><p>4.问你的期望薪资多少</p><p>5.问我想听听你对加班什么看法</p><p>6.最后让明天面试，我说不行，能最晚啥时候，她说最晚周五下午，电话面试</p><h4 id="二面-面试官狗叫-15分钟" tabindex="-1"><a class="header-anchor" href="#二面-面试官狗叫-15分钟" aria-hidden="true">#</a> 二面：面试官狗叫（15分钟 ）</h4><p>面试官的态度极其恶心，什么垃圾玩意，老子是来面试的，不是听狗叫的，就算老子啥都不会也不去你这个垃圾公司。</p><p>1.自我介绍，直接打断说只介绍自己会的，项目中的技术栈</p><p>2.问我熟悉哪些框架，我说Spring、Mysql，其他都是了解，熟悉的是Java基础和Mysql，他就非得问SpringBoot，离谱</p><p>3.问Kafka的分区、主题了解吗，我就是了解，然后他也说了你只是了解</p><p>4.问ES了解吗（我只是了解他是干啥的，其它都是API）</p><p>5.问SpringBoot异常怎么处理（这个紧张忘了，只是说在一个包里要继承一个异常的接口）</p><p>6.问SpringBoot的核心配置文件以及它们的区别</p><p>7.问SpringBoot的起步依赖starter有哪些以及作用（他说你了解的很少，我都说了了解Mysql、Spring，你他妈的非得问）</p><p>8.问SpringBoot 中的监视器是什么（我说不了解）</p><p>9.问Swagger用过么、它用来做什么</p><p>10.问什么是 WebSockets（我说只了解它是用来作为即时通讯的协议）</p><p>11.问什么是 FreeMarker 模板（这个离谱，说完他是干啥的以及插值表达式，他问还有呢？他妈的）</p><p>12.问C/S 、B/S模式</p><p>13.问String、StringBuilder、StringBuffer 的区别</p><p>14.问了MySQL的存储引擎</p><p>15.问了 InnoDB 和 MyISAM 的比较</p><p>16.问了建立索引的原则</p><p>17.问了三大范式</p><p>18.问了Jdbc的防止sql注入（我说不了解）</p><p>19.反问（我说实习生的日常工作安排是什么，他妈的开始狗叫，想打他）</p><p>20.最后问我啥时能来实习（老子不去）</p><h3 id="二、联想" tabindex="-1"><a class="header-anchor" href="#二、联想" aria-hidden="true">#</a> 二、联想</h3><h4 id="一面-16分钟" tabindex="-1"><a class="header-anchor" href="#一面-16分钟" aria-hidden="true">#</a> 一面：（16分钟）</h4><p>1.说一下红黑树（吧啦吧啦，讲了下红黑树的特性、又扯到HashMap底层用到了红黑树、突然说到MySQLB+树用到了红黑树）</p><p>2.讲一下线程池（这个熟，线程池的7大参数以及具体用法）</p><p>3.讲一下为什么用线程池（两点原因）</p><p>4.讲一下线程池参数MaxSize满了你会怎么做（我说实现自定义处理策略，可以选择移除等待队列中的最不常用的线程）</p><p>5.看我熟悉Python（这里没听清发音，重复确认了好几遍哈哈哈哈哈哈哈），问我生成器用过没（我说是生成随机数吗，面试官说不是，是，还耐心给我解答了是用来循环遍历的）</p><p>5.项目拷打环节</p><p>1）讲一下你的项目经验（从项目的整体架构到具体功能实现细节都说了）</p><p>2）我说了做的一些优化（存储到阿里云OSS）</p><p>3）突然电话断了，在那我俩喂喂喂了好几声，面试官又给我打了过来，问我同步和异步怎么实现的（加@Async注解）</p><p>4）问异步调用后，做了些什么（第三方接口审核完后传来一个statusCode200，表示审核成功存储到数据库）</p><p>6.反问环节</p><p>1）实习生的日常工作安排（面试官说了早上9：30上班，下午6：30下班，八小时工作制，中午休息一小时）</p><p>2）技术栈是什么（面试官说这有Java和Python，你来就是Java）</p><h3 id="三、中国邮政储蓄银行" tabindex="-1"><a class="header-anchor" href="#三、中国邮政储蓄银行" aria-hidden="true">#</a> 三、中国邮政储蓄银行</h3><h4 id="一面-结构化面试-技术面-20分钟-五个面试官" tabindex="-1"><a class="header-anchor" href="#一面-结构化面试-技术面-20分钟-五个面试官" aria-hidden="true">#</a> 一面：结构化面试+技术面（20分钟，五个面试官）</h4><p>1.先做一个两分钟以内的自我介绍（对邮储的看法，对未来工作的看法）</p><p>2.对工作地点的看法</p><p>3.有没有参加过团体活动</p><p>4.数学建模比赛中遇到的最大困难</p><p>5.开始技术面试了，面试官说看你简历都是Java相关，讲一下Spring Cloud你用过的组件</p><p>6.ConcurrentHashMap为什么用红黑树</p><p>7.看你项目中用到了网关，是怎么实现的</p><p>8.都说CAS要比synchronized好，但是CAS也有自己的问题，你能说一下有哪些问题吗</p><p>9.另一个面试官问看你简历有高并发系统的东西，你有实际的项目经验吗（这个我说就是了解，实际项目是自学的，实际项目经验都是人工智能相关的）</p><p>10.最后女的HR问看你成绩这么好，没有保研吗</p><p>11.讲一下研究生的论文成果</p><p>12.研究生的专业成绩排名，有获得过奖学金吗</p><p>13.最后问有offer吗，方便说一下是哪个公司吗</p><p>另：</p><p>1.对工作地点的看法</p><p>2.CPU达到100%的时候你如何排查问题</p><p>3.新生代和老年代数据是如何流动的</p><p>4.Linux如何给文件权限</p><p>5.想从实习中收获什么</p><p>6.看你是院研副部长，如果负责的活动和实验室科研冲突了怎么平衡</p><p>7.你平常也这样扎头发吗</p><h2 id="秋招" tabindex="-1"><a class="header-anchor" href="#秋招" aria-hidden="true">#</a> 秋招</h2><h3 id="一、海尔-提前批一面11min-经理技术面-hr面-挂" tabindex="-1"><a class="header-anchor" href="#一、海尔-提前批一面11min-经理技术面-hr面-挂" aria-hidden="true">#</a> 一、海尔（提前批一面11min：经理技术面+HR面）：挂</h3><p>1.自我介绍</p><p>2.就关于应聘的软件开发岗位谈一下实际的开发</p><p>3.对于取得的最终效果讲一下</p><p>4.看了你去年做了一个博客社区的项目（？？？去年，博客社区？这个经理不太专业呀），你是用MD5做的，那么MD5它能够被破解吗（我说算力够的话能够被破解，对面不满意？？？）</p><p>5.那你熟悉这个加密算法吗？它属于对称加密还是非对称加密（凉了，直接说不熟悉）</p><p>6.我看到你用到了ThreadLocal，那你能简单说下ThreadLocal的原理吗？</p><p>7.那你什么时间把这个对象删除的呢？我看你为了防止内存泄漏，那你怎么判断它使用完了呢？</p><p>8.Token失效谁判断的？</p><p>9.说我python写得多，而他们用Java比较多，所以问我一个逻辑题：甲乙两个人，有2-6五张牌，甲乙各抽一张，你怎么判断谁大谁小？（离谱，我简历上都是Java，这是不想要我刷KPI呢）</p><h3 id="二、浪潮-20min-技术面-hr面-9-20" tabindex="-1"><a class="header-anchor" href="#二、浪潮-20min-技术面-hr面-9-20" aria-hidden="true">#</a> 二、浪潮（20min：技术面+HR面）9.20</h3><h4 id="hr面" tabindex="-1"><a class="header-anchor" href="#hr面" aria-hidden="true">#</a> HR面：</h4><p>1.自我介绍</p><p>2.你家是山东的，是考研到这个学校的吗？</p><p>3.你对工作地点的选择，为什么？如果没有浪潮，你会选哪个地点？</p><p>4.你学习挺好研究生排名高</p><p>5.你还找了哪些公司？</p><p>6.其他地方的工作不考虑吗？</p><p>7.在西安你找了哪些公司？</p><p>8.你在联想实习是在天津实现吗？在北京没有考虑吗？</p><p>9.看你填了全国可长期出差，你有女朋友吗？</p><p>10.你想在研究生期间的地方找工作？</p><h4 id="技术面" tabindex="-1"><a class="header-anchor" href="#技术面" aria-hidden="true">#</a> 技术面：</h4><p>1.看你写了博客，比的博客都是关于什么内容的？</p><p>2.你实习是在AI组，后面有没有转软件开发的可能？</p><p>3.你有没有做过项目？</p><p>4.听到你用了ThreadLocal，它是干啥的，咋用的，哪些变量用了？</p><p>5.看你熟悉线程池，你讲一下线程池？</p><p>6.线程池用了ThreadLocal，如何不让多个线程使用？</p><p>7.熟悉Mysql吗，说一下四大隔离级别？</p><p>8.你最喜欢用哪个隔离级别？</p><p>9.普通的select语句加不加锁？</p><p>10.你说一下什么是可重复读？</p><h4 id="加面-20min-10-8" tabindex="-1"><a class="header-anchor" href="#加面-20min-10-8" aria-hidden="true">#</a> 加面：20min 10.8</h4><p>1.咱们就不问简单的技术了，看你简历上写的技术点挺多的，直接专业场景面试</p><p>2.你说一下List、Set、Map的区别？</p><p>3.来个场景题，List里面存的是学生类，那么怎么按照学生成绩排序，JDK1.7以前怎么用？</p><p>4.来个数据库的场景题，你说一下怎么查询某个学科下某个班级的成绩前五名？</p><p>5.数据库你都用过哪些？</p><p>6.你说一下单例模式和多例模式的区别？</p><p>7.你了解观察者模式模式吗？（不了解，没有使用过）</p><p>8.你了解算法吗？（我说我做的深度学习的算法，面试官说我也不会深度学习，相视一笑）</p><p>9.你说一下快速排序算法的思想？</p><p>10.你讲一下用户页面发起一个请求到调用数据库返回数据的流程，用到了哪些技术，越详细越好？</p><p>11.你熟悉linux吗？你说一下怎么查看文件？</p><p>12.来个场景题，现在有5个文件，怎么找到自己想要的内容（我说了grep，然后准备说怎么写命令，面试官说不用说了，剩下的百度就行）</p><p>13.你有什么想问我的吗？（我问我现在是调到了哪个部门？然后面试官说现在是国资委服务部门，需要出差。然后我问主要的技术栈和业务是啥，面试官说主要是Java，现在准备做大模型。）</p><p>14.面试官说你啥时候可以来实习，我说得到12月份，现在得写毕业论文。面试官说你可以来实习体验一下公司氛围，咱俩加了微信，你来的时候就微信聊。</p><h3 id="三、科大讯飞-40min-技术面-9-22" tabindex="-1"><a class="header-anchor" href="#三、科大讯飞-40min-技术面-9-22" aria-hidden="true">#</a> 三、科大讯飞（40min：技术面）9.22</h3><h4 id="技术一面" tabindex="-1"><a class="header-anchor" href="#技术一面" aria-hidden="true">#</a> 技术一面：</h4><p>1.自我介绍</p><p>2.面试官说我问一下基础知识，你说一下抽象类和接口的区别？</p><p>3.你了解设计模式吗？</p><p>4.你了解代理模式吗？</p><p>5.你了解垃圾回收吗？</p><p>6.你知道什么时候进行young gc和full gc吗？（这个回答的full gc）</p><p>7.你有没有JVM调优或者CPU、内存调优经验，你是怎么调的？</p><p>8.我问一下题外话，你的发型是做的还是睡觉睡的？</p><p>9.没有别的意思，看你面试状态很好，你面了几家了？</p><p>10.你说了volitle，发音不准确没关系，我问这个怕你听不懂所以一开始没问，那你说一下和syschronized的区别？</p><p>11.你用过哪些中间件？</p><p>12.说一下浅拷贝和深拷贝？</p><p>13.你用过索引没有，为了加快检索，那么为什么能加快检索？</p><p>14.你刚才提到了消息中间件kafka，你说一下它？</p><p>15.你用过es没？（我只是说我照着api调的，面试官说没关系）</p><p>16.有一个进程PID，你怎么找到里面的线程？</p><p>17.你是怎么查看堆栈信息，假如有一万行的堆栈信息，你怎么查看？（这个我说一页一页的看，感觉不行问面试官咋看，面试官说jstack下载下来然后用专业的工具看，你不会没关系）</p><p>18.基础问完了，那么我们现在问一下，你用过哪些spring的注解？</p><p>19.spring里面重要的ioc控制反转和面向切面编程，你来给我讲一下面相切面编程？</p><p>20.你说一下spring boot启动的流程？</p><p>21.好了，专业知识问完了，咱们接下来聊一聊非专业的问题，看你是在联想实习，你怎么想到跑这么远？来回回学校不麻烦吗？（我说我科研做完了，就光写大论文了）</p><p>22.你的大论文是关于什么的？</p><p>23.你给我说一下你在公司里做的？</p><p>24.你调用了哪些大模型？</p><p>25.你在公司里写了多少行代码，你大概估计一下？（我说差不多上千行，我也记不清了，面试官说我问你这个问题就是想看你是偏技术调研的还是偏代码的，看来代码写的挺多的）</p><p>26.你用过讯飞星火大模型吗？</p><p>27.你用的最多的是文生文还是文生图？（这地方吹了一下星火比其他三家的好用，我说用的最多的是写代码，面试官说大家都是写代码，我还没体验过阿里的，一直没审核通过，过段时间讯飞大模型会升级）</p><p>28.你现在有学习什么新技术吗？</p><p>29.你有什么想问我的？（我问了面试官您是做什么，面试官说我是ai研发，整个ai流程都做，你做的大模型是比较简单的，我们更上层的开发，你面试通过的话也是在我们这边。我问面试官讯飞的数据集有没有开源，面试官说讯飞的开源相比其他厂商做的很差，没有开源，包括讯飞的大模型也没有开源）</p><h4 id="技术二面-30min-10-20" tabindex="-1"><a class="header-anchor" href="#技术二面-30min-10-20" aria-hidden="true">#</a> 技术二面：30min 10.20</h4><p>垃圾面试官，迟到二十多分钟，上来板着脸问我几个场景题，四个都不会还让写代码，垃圾面试官显得自己很牛逼，太倒霉碰见这样的垃圾面试官。</p><p>1.自我介绍</p><p>2.你的项目是自己做的吗？</p><p>3.你的项目并发数达到2w，有这么高吗？（我说用JMeter测试，开了2w个线程，通过率80%）</p><p>4.你的时延多少？（我说忘了，垃圾问我这简历上没有的）</p><p>5.你在联想实习过，你说一下爬虫的收获？</p><p>6.在上传文件是该如何构造请求报文？（我说我没有构造过，他还问，垃圾）</p><p>7.在下载文件时如何限制下载速率？（我不会，他还问，垃圾）</p><p>8.线上项目OOM了怎么定位？（我说没有这方面经验，他还问，垃圾）</p><p>9.线上项目卡顿有延迟如何找到哪地方的异常？（我说没有这方面经验，他还问，就说用JMeter测试接口，看哪个接口异常，就去看这个接口，他还问，垃圾）</p><p>10.他让手撕两个代码，单例模式和密码验证逻辑，太垃圾，正则表达式我不会，还让写，垃圾面试官</p><p>11.他说行了，开始kpi了，让我讲一下遇到困难怎么解决？然后又问现在有要完成的任务，需要别的组来完成，但是别的组没时间，你该怎么做？</p><p>12.反问他是写什么语言的，他随口一句啥都有，垃圾面试官</p><h3 id="四、比亚迪-15min-hr面-10-19" tabindex="-1"><a class="header-anchor" href="#四、比亚迪-15min-hr面-10-19" aria-hidden="true">#</a> 四、比亚迪（15min：HR面）10.19</h3><p>比亚迪一面线下hr面，好多人排队，本来10:30的等到十一点半，问题都记不太清。</p><p>1.面试官是个女性，上来跟她打招呼她听口音以为我是南方人呢</p><p>2.自我介绍</p><p>3.问我是不是数学好</p><p>4.对工作地点有什么意向</p><p>5.说一下对比亚迪的认识（这个正好前几天比亚迪宣讲会上听了，开始扯了比亚迪的起家，业务以及销量）</p><p>6.意向岗位是不是系统开发</p><p>7.选择客车还是小轿车进行自动驾驶开发</p><h3 id="五、中邮消费金融-10min-技术面-hr面-一个面试官-另一个刚进来又走了-10-31" tabindex="-1"><a class="header-anchor" href="#五、中邮消费金融-10min-技术面-hr面-一个面试官-另一个刚进来又走了-10-31" aria-hidden="true">#</a> 五、中邮消费金融（10min：技术面 + HR面，一个面试官，另一个刚进来又走了）10.31</h3><p>1.自我介绍</p><p>2.我看你在联想做的是AI相关的，为什么考虑转开发？（我说需求少，面试官笑了）</p><p>3.你在联想没有转正的原因你觉得是什么？</p><p>4.你用过哪些Java的框架？</p><p>5.你用过SpringMVC吗？</p><p>6.你了解Spring的事务吗？</p><p>7.你了解事物传播行为吗？</p><p>8.你学习了哪些新技术？</p><p>9.你学习Spring CLoud的感受？</p><p>10.你学习技术的途径？</p><p>11.你未来的职业规划？</p>',184),n=[i];function d(t,s){return a(),e("div",null,n)}const l=p(h,[["render",d],["__file","面试.html.vue"]]);export{l as default};
